import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Scatter, Line } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const StatisticalContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const ModelSection = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 40px;
  margin-bottom: 40px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const ModelTitle = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.7rem;
  color: #1e3a8a;
  margin-bottom: 25px;
  display: flex;
  align-items: center;
  gap: 12px;
`;

const TabContainer = styled.div`
  display: flex;
  margin-bottom: 30px;
  border-bottom: 2px solid #e2e8f0;
`;

const Tab = styled.button`
  background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'transparent'};
  color: ${props => props.active ? 'white' : '#64748b'};
  border: none;
  padding: 15px 25px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  border-radius: 8px 8px 0 0;
  transition: all 0.3s ease;
  margin-right: 5px;

  &:hover {
    background: ${props => props.active ? 'linear-gradient(135d, #1e3a8a, #3730a3)' : 'rgba(100, 116, 139, 0.1)'};
  }
`;

const ModelResults = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 30px;
  margin-bottom: 30px;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const ResultsTable = styled.div`
  background: #f8fafc;
  border-radius: 12px;
  padding: 25px;
  border: 1px solid #e2e8f0;
`;

const TableTitle = styled.h4`
  font-size: 1.2rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  font-weight: 600;
`;

const TableRow = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr 1fr 1fr;
  gap: 15px;
  padding: 12px 0;
  border-bottom: 1px solid #e2e8f0;
  font-size: 0.95rem;

  &:first-child {
    font-weight: 600;
    color: #374151;
    background: #e2e8f0;
    padding: 15px 10px;
    border-radius: 8px;
    margin-bottom: 10px;
  }

  &:last-child {
    border-bottom: none;
  }
`;

const Variable = styled.span`
  font-weight: 500;
  color: #374151;
`;

const Coefficient = styled.span`
  color: ${props => props.significant ? '#059669' : '#6b7280'};
  font-weight: ${props => props.significant ? '600' : '400'};
`;

const PValue = styled.span`
  color: ${props => {
    if (props.value < 0.001) return '#dc2626';
    if (props.value < 0.01) return '#ea580c';
    if (props.value < 0.05) return '#ca8a04';
    return '#6b7280';
  }};
  font-weight: ${props => props.value < 0.05 ? '600' : '400'};
`;

const ChartContainer = styled.div`
  margin: 30px 0;
`;

const ChartTitle = styled.h4`
  font-size: 1.3rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  text-align: center;
`;

const ModelExplanation = styled.div`
  background: linear-gradient(135deg, #dbeafe, #bfdbfe);
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid #3b82f6;
  margin: 25px 0;
`;

const ExplanationTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1e40af;
  margin-bottom: 12px;
`;

const ExplanationText = styled.p`
  font-size: 0.95rem;
  color: #1e40af;
  line-height: 1.6;
  margin: 0;
`;

const StatisticalAnalysis = () => {
  const [activeModel, setActiveModel] = useState('logistic');

  const logisticResults = [
    { variable: 'Baseline Volume (>100 patients)', coefficient: '2.34', ci: '2.18-2.52', pvalue: '<0.001', significant: true },
    { variable: 'Community Health Center', coefficient: '1.89', ci: '1.67-2.14', pvalue: '<0.001', significant: true },
    { variable: 'Rural Setting', coefficient: '0.67', ci: '0.58-0.77', pvalue: '<0.001', significant: true },
    { variable: 'Medicaid Expansion State', coefficient: '1.43', ci: '1.28-1.60', pvalue: '<0.001', significant: true },
    { variable: 'Nurse Practitioner', coefficient: '0.82', ci: '0.74-0.91', pvalue: '<0.001', significant: true },
    { variable: 'Years in Practice (>10)', coefficient: '1.25', ci: '1.16-1.35', pvalue: '<0.001', significant: true }
  ];

  const multinomialResults = [
    { variable: 'Baseline Volume (>100)', outcome: 'Major Increase', coefficient: '3.21', pvalue: '<0.001', significant: true },
    { variable: 'Baseline Volume (>100)', outcome: 'Major Decrease', coefficient: '0.31', pvalue: '<0.001', significant: true },
    { variable: 'CHC Affiliation', outcome: 'Major Increase', coefficient: '2.45', pvalue: '<0.001', significant: true },
    { variable: 'CHC Affiliation', outcome: 'Major Decrease', coefficient: '0.42', pvalue: '<0.001', significant: true },
    { variable: 'Rural Setting', outcome: 'Major Increase', coefficient: '0.78', pvalue: '0.023', significant: true },
    { variable: 'Rural Setting', outcome: 'Major Decrease', coefficient: '1.47', pvalue: '<0.001', significant: true }
  ];

  const predictiveAccuracy = {
    labels: ['Stable', 'Major Increase', 'Major Decrease', 'Overall'],
    datasets: [{
      label: 'Model Accuracy (%)',
      data: [78, 72, 69, 74],
      backgroundColor: ['#f59e0b', '#10b981', '#ef4444', '#3b82f6'],
      borderRadius: 8,
    }]
  };

  const residualPlot = {
    datasets: [{
      label: 'Model Residuals',
      data: [
        {x: 1, y: 0.12}, {x: 2, y: -0.08}, {x: 3, y: 0.15}, {x: 4, y: -0.04},
        {x: 5, y: 0.21}, {x: 6, y: -0.13}, {x: 7, y: 0.09}, {x: 8, y: -0.17},
        {x: 9, y: 0.06}, {x: 10, y: -0.11}, {x: 11, y: 0.18}, {x: 12, y: -0.07}
      ],
      backgroundColor: 'rgba(59, 130, 246, 0.6)',
      borderColor: '#3b82f6',
      pointRadius: 5,
    }]
  };

  const renderLogisticResults = () => (
    <div>
      <ResultsTable>
        <TableTitle>Logistic Regression Results - Stable vs Volatile Participation</TableTitle>
        <TableRow>
          <span>Predictor Variable</span>
          <span>Odds Ratio</span>
          <span>95% CI</span>
          <span>P-Value</span>
        </TableRow>
        {logisticResults.map((result, index) => (
          <TableRow key={index}>
            <Variable>{result.variable}</Variable>
            <Coefficient significant={result.significant}>{result.coefficient}</Coefficient>
            <span>{result.ci}</span>
            <PValue value={parseFloat(result.pvalue.replace('<', '')) || 0.001}>
              {result.pvalue}
            </PValue>
          </TableRow>
        ))}
      </ResultsTable>

      <ModelExplanation>
        <ExplanationTitle>Model Interpretation</ExplanationTitle>
        <ExplanationText>
          The logistic regression model explains 34% of variance in provider stability (Nagelkerke RÂ² = 0.34). 
          Baseline patient volume emerges as the strongest predictor, with providers serving >100 patients 
          having 2.34 times higher odds of stable participation. CHC affiliation and Medicaid expansion 
          significantly improve stability odds, while rural settings reduce them.
        </ExplanationText>
      </ModelExplanation>
    </div>
  );

  const renderMultinomialResults = () => (
    <div>
      <ResultsTable>
        <TableTitle>Multinomial Logistic Regression - Three-Category Outcomes</TableTitle>
        <TableRow>
          <span>Predictor Variable</span>
          <span>Outcome</span>
          <span>Odds Ratio</span>
          <span>P-Value</span>
        </TableRow>
        {multinomialResults.map((result, index) => (
          <TableRow key={index}>
            <Variable>{result.variable}</Variable>
            <span style={{ 
              color: result.outcome === 'Major Increase' ? '#059669' : '#dc2626',
              fontWeight: '500'
            }}>
              {result.outcome}
            </span>
            <Coefficient significant={result.significant}>{result.coefficient}</Coefficient>
            <PValue value={parseFloat(result.pvalue.replace('<', '')) || 0.001}>
              {result.pvalue}
            </PValue>
          </TableRow>
        ))}
      </ResultsTable>

      <ModelExplanation>
        <ExplanationTitle>Multinomial Model Insights</ExplanationTitle>
        <ExplanationText>
          Using stable participation as the reference category, the multinomial model reveals that 
          high baseline volume dramatically increases odds of major increases (OR=3.21) while 
          protecting against major decreases (OR=0.31). Rural providers face 47% higher odds 
          of major decreases, highlighting geographic disparities in Medicaid participation.
        </ExplanationText>
      </ModelExplanation>
    </div>
  );

  return (
    <StatisticalContainer>
      <SectionTitle>Statistical Analysis & Modeling</SectionTitle>
      <SectionSubtitle>
        Advanced statistical models reveal the complex relationships between provider characteristics, 
        practice settings, and Medicaid participation patterns
      </SectionSubtitle>

      <ModelSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.1 }}
      >
        <ModelTitle>ðŸ“Š Regression Analysis Results</ModelTitle>

        <TabContainer>
          <Tab 
            active={activeModel === 'logistic'}
            onClick={() => setActiveModel('logistic')}
          >
            Binary Logistic Model
          </Tab>
          <Tab 
            active={activeModel === 'multinomial'}
            onClick={() => setActiveModel('multinomial')}
          >
            Multinomial Model
          </Tab>
        </TabContainer>

        {activeModel === 'logistic' ? renderLogisticResults() : renderMultinomialResults()}
      </ModelSection>

      <ModelSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.2 }}
      >
        <ModelTitle>ðŸŽ¯ Model Performance & Validation</ModelTitle>

        <ModelResults>
          <div>
            <ChartContainer>
              <ChartTitle>Predictive Accuracy by Outcome Category</ChartTitle>
              <div style={{ height: '300px' }}>
                <Bar 
                  data={predictiveAccuracy} 
                  options={{ 
                    responsive: true, 
                    maintainAspectRatio: false,
                    scales: {
                      y: { beginAtZero: true, max: 100 }
                    },
                    plugins: {
                      legend: { display: false }
                    }
                  }} 
                />
              </div>
            </ChartContainer>
          </div>

          <div>
            <ChartContainer>
              <ChartTitle>Model Residual Analysis</ChartTitle>
              <div style={{ height: '300px' }}>
                <Scatter 
                  data={residualPlot} 
                  options={{ 
                    responsive: true, 
                    maintainAspectRatio: false,
                    scales: {
                      x: { 
                        title: { display: true, text: 'Fitted Values' },
                        beginAtZero: true 
                      },
                      y: { 
                        title: { display: true, text: 'Residuals' },
                        beginAtZero: false 
                      }
                    },
                    plugins: {
                      legend: { display: false }
                    }
                  }} 
                />
              </div>
            </ChartContainer>
          </div>
        </ModelResults>

        <ModelExplanation>
          <ExplanationTitle>Model Validation Results</ExplanationTitle>
          <ExplanationText>
            Cross-validation using 80/20 train-test split demonstrates robust model performance with 
            74% overall accuracy. The model shows highest accuracy for stable participation (78%) 
            and lowest for major decreases (69%), reflecting the challenge of predicting provider 
            exits. Residual analysis shows acceptable normality with no significant patterns.
          </ExplanationText>
        </ModelExplanation>
      </ModelSection>

      <ModelSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.3 }}
